import React, { useState, useRef } from 'react';

export default function Upload({ onNext }) {
  const [docType, setDocType] = useState('');
  const [files, setFiles] = useState([]);
  const fileInputRef = useRef(null);

  const handleFileChange = (e) => {
    if (e.target.files && e.target.files.length > 0) {
      const newFiles = Array.from(e.target.files);
      setFiles(prevFiles => [...prevFiles, ...newFiles]);
    }
  };

  const triggerFileInput = (e) => {
    e.preventDefault();
    e.stopPropagation();
    if (fileInputRef.current) {
      fileInputRef.current.click();
    }
  };

  const handleDrop = (e) => {
    e.preventDefault();
    e.stopPropagation();
    if (e.dataTransfer.files && e.dataTransfer.files.length > 0) {
      const droppedFiles = Array.from(e.dataTransfer.files);
      setFiles(prevFiles => [...prevFiles, ...droppedFiles]);
    }
  };

  const handleDragOver = (e) => {
    e.preventDefault();
    e.stopPropagation();
  };

  const removeFile = (index, e) => {
    e.stopPropagation();
    setFiles(prevFiles => prevFiles.filter((_, i) => i !== index));
  };

  const handleContinue = () => {
    onNext({ files, documentType: docType });
  };

  return (
    <div className="container">
      <h2>üìÑ Upload Identity Documents</h2>
      <p>Upload your Aadhaar, PAN, Passport, or other ID documents to extract information</p>

      <div className="form-group">
        <label>Document Type *</label>
        <select value={docType} onChange={(e) => setDocType(e.target.value)}>
          <option value="">Select document type...</option>
          <option value="Aadhaar">üÜî Aadhaar Card</option>
          <option value="PAN">üí≥ PAN Card</option>
          <option value="Passport">üõÇ Passport</option>
          <option value="Driving License">üöó Driving License</option>
          <option value="Voter ID">üó≥Ô∏è Voter ID</option>
          <option value="Other">üìã Other ID</option>
        </select>
      </div>

      <input 
        ref={fileInputRef}
        type="file" 
        multiple 
        accept=".pdf,.jpg,.jpeg,.png" 
        onChange={handleFileChange} 
        style={{ display: 'none' }} 
      />

      <div 
        className="upload-zone" 
        onClick={triggerFileInput}
        onDrop={handleDrop}
        onDragOver={handleDragOver}
        role="button"
        tabIndex={0}
        onKeyPress={(e) => {
          if (e.key === 'Enter' || e.key === ' ') {
            triggerFileInput(e);
          }
        }}
      >
        <div className="upload-icon">‚¨ÜÔ∏è</div>
        <div style={{ fontSize: '1.1rem', fontWeight: '600', color: '#374151', marginBottom: '0.5rem' }}>
          Drop files here or click to upload
        </div>
        <small style={{ color: '#9ca3af' }}>Supports PDF, JPG, PNG (Max 10MB per file)</small>
      </div>

      {files.length > 0 && (
        <div className="files">
          <h3 style={{ marginBottom: '1rem', color: '#374151' }}>
            üìÇ Uploaded Documents ({files.length})
          </h3>
          {files.map((f, i) => (
            <div key={i} className="file">
              <div className="file-icon">üìÑ</div>
              <div className="file-info">
                <div className="file-name">{f.name}</div>
                <div className="file-type">{docType || 'No type selected'} ‚Ä¢ {(f.size / 1024).toFixed(1)} KB</div>
              </div>
              <span style={{ color: '#10b981', fontSize: '1.5rem' }}>‚úì</span>
              <button 
                onClick={(e) => removeFile(i, e)}
                style={{
                  background: 'transparent',
                  border: 'none',
                  color: '#ef4444',
                  cursor: 'pointer',
                  fontSize: '1.2rem',
                  padding: '0.5rem'
                }}
              >
                ‚úï
              </button>
            </div>
          ))}
        </div>
      )}

      <div className="buttons">
        <button 
          className="btn btn-primary" 
          onClick={handleContinue} 
          disabled={!docType || files.length === 0}
        >
          Continue to Extract ‚Üí
        </button>
      </div>
    </div>
  );
}
